import { Link } from 'react-router-dom';
import { StyledNavLink } from '../../app-styled'; 

const Header = () => {
  return(
    <header className="header">
      <h1 $isPrimary>Elisabeth Vicente FE Dev</h1>
      <nav>
        <Link className='nav-link' to="/"><StyledNavLink $isPrimary={false} >Homepage</StyledNavLink></Link>
        <Link className="nav-link" to="/currency-converter"><StyledNavLink $isPrimary={false}>Currency Converter</StyledNavLink></Link>
        <Link className="nav-link" to="/content-page"><StyledNavLink $isPrimary={false}>Images Api</StyledNavLink></Link>
        <Link className="nav-link" to="/contact"><StyledNavLink $isPrimary>Contact</StyledNavLink></Link>
      </nav>
      <a href=''>
        <img src='/linkedin-icon.svg' alt='join me on linkedin' />
      </a>
    </header>
  );
}

export default Header;
